import React from "react";
import Layout from "../component/Layout";
import Splash from "../component/Splash";

export default class Index extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <Layout className="justify-content-center">
        <Splash />
        Index
      </Layout>
    );
  }
}
